function Dropdown() {
    return (
        <div class="dropdown">
            <button class="dropbtn">Dropdown</button>
            <ul class="dropdown-content">
                <li>Link 1</li>
                <li>Link 2</li>
                <li>Link 3</li>
            </ul>
        </div>
    )
}
export default Dropdown
